import React from "react";
import Sidebar from "./components/Sidebar";
import Chat from "./components/Chat";
import "./App.css";

const App = ({ mode, user, onLogout }) => {
  return (
    <div className="app-container">
      <Sidebar mode={mode} user={user} onLogout={onLogout} />
      <Chat user={user} />
    </div>
  );
};

export default App;
